@zeroflag due to the difference between trunk and branch-2.7 with regards to managing parallelScheduler for Rolling Upgrade, branch-2.7 does not have any test cases covering [addTasksToStageInBatches](https://github.com/apache/ambari/blob/193359448c30833d12c6344f7d4e3611e91670be/ambari-server/src/main/java/org/apache/ambari/server/state/stack/upgrade/Grouping.java#L229)

Hence, I have not included test case changes with this cherry-pick commit. Please let me know if it is fine with you. It is covered in trunk though.
If required, we can cover this whole method with various test-cases in future with separate commit in branch-2.7?
